INSERT INTO `core_docs` VALUES (2,1,0,'Справочный документ','','',''),(4,1,1,'1','','',''),(5,1,1,'2','','',''),(6,1,1,'3','','',''),(7,0,1,'Документация по серверной части',NULL,NULL,NULL),(8,7,1,'Классы системы',NULL,NULL,NULL),(9,8,1,'Instruments',NULL,NULL,NULL),(10,8,1,'Utils',NULL,NULL,NULL),(11,8,0,'App','<p>Класс, хранящий константы.</p>\n\n<h2>Константы:</h2>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M1 =&nbsp;&quot;M1&quot;</div>\n\n<p>Константа обозначающая 1 минуту.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M2&nbsp;=&nbsp;&quot;M2&quot;</div>\n\n<p>Константа обозначающая 2&nbsp;минуты.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M5&nbsp;=&nbsp;&quot;M5&quot;</div>\n\n<p>Константа обозначающая 5&nbsp;минут.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M10 =&nbsp;&quot;M10&quot;</div>\n\n<p>Константа обозначающая 10 минут.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M15 =&nbsp;&quot;M15&quot;</div>\n\n<p>Константа обозначающая 15 минут.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_M30&nbsp;=&nbsp;&quot;M30&quot;</div>\n\n<p>Константа обозначающая 30&nbsp;минут.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_H1 =&nbsp;&quot;H1&quot;</div>\n\n<p>Константа обозначающая 1 час.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_H4 =&nbsp;&quot;H4&quot;</div>\n\n<p>Константа обозначающая 4 часа.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TF_D1 =&nbsp;&quot;D1&quot;</div>\n\n<p>Константа обозначающая 1 день.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::INSTRUMENT_OIL = &quot;OIL&quot;</div>\n\n<p>&nbsp;</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::PRICE_STEP = 0.05</div>\n\n<p>Ценовой шаг.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TICK_BUY = 1</div>\n\n<p>Тип покупки.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TICK_SELL = 2</div>\n\n<p>Тип продажи.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">App::TICK_BUY_SELL = 3</div>\n\n<p>Тип покупки и продажи.</p>\n',NULL,NULL),(12,8,0,'Candle',NULL,NULL,NULL),(13,10,0,'TimeCalculator',NULL,NULL,NULL),(14,10,0,'Timestamp','<h2>Методы:</h2>\n\n<p>Конструктор создает объект метки времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">String &nbsp; &nbsp;&nbsp;<code><strong>toString</strong></code>(void)</div>\n\n<p>Возвращает метку времени как строку.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">Int&nbsp; &nbsp; &nbsp;<code><strong>getTimestamp</strong></code>(void)</div>\n\n<p>Возвращает метку времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">void &nbsp; &nbsp;<code><strong>addSeconds</strong></code>(Int $seconds)</div>\n\n<p>Добавляет количество секунд $seconds к метке времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">void &nbsp; &nbsp;<code><strong>subtractSeconds</strong></code>(Int $seconds)</div>\n\n<p>Вычитает количество секунд $seconds из метки&nbsp;времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">void&nbsp; &nbsp;&nbsp;<code><strong>addMinutes</strong></code>(Int $minutes)</div>\n\n<p>Добавляет количество минут $minutes к метке времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">void&nbsp; &nbsp;&nbsp;<code><strong>subtractMinutes</strong></code>(Int $minutes)</div>\n\n<p>Вычитает количество минут $minutes от&nbsp;метки&nbsp;времени.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">Timestamp&nbsp;<code><strong>getLaterForSeconds</strong></code>(Int $seconds)</div>\n\n<p>Возвращает новую метку времени, которая больше текущей на $seconds секунд.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">Timestamp&nbsp;<code><strong>getEarlierForSeconds</strong></code>(Int $seconds)</div>\n\n<p>Возвращает новую метку времени, которая меньше текущей на $seconds секунд.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">Timestamp&nbsp;<code><strong>getLaterForMinutes</strong></code>(Int $minutes)</div>\n\n<p>Возвращает новую метку времени, которая больше текущей на $minutes минут.</p>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">Timestamp&nbsp;<code><strong>getEarlierForMinutes</strong></code>(Int $minutes)</div>\n\n<p>Возвращает новую метку времени, которая меньше текущей на $minutes минут.</p>\n',NULL,NULL),(15,9,0,'Instrument','<p>Абстрактный класс объекта инструмент.</p>\n\n<h2>Методы:</h2>\n\n<div style=\"background:#eee;border:1px solid #ccc;padding:5px 10px;\">&nbsp;</div>\n\n<p>&nbsp;</p>\n',NULL,NULL);
