INSERT INTO `core_pages` VALUES (1,300,'Новая страница','/text/','<meta name=\'viewport\' content=\'initial-scale=1, width=device-width, user-scalable=no\'/>\r\n        <base href=\'/vtresurs\'/>\r\n        \r\n        \r\n        <link rel=\'stylesheet\' href=\'/css/main.css\'>\r\n        <link rel=\'stylesheet\' href=\'/css/section.css\'/>\r\n        \r\n        <script src=\'/js/jquery.js\'></script>\r\n        <link rel=\"stylesheet\" type=\"text/css\" href=\"//cdn.jsdelivr.net/jquery.slick/1.6.0/slick.css\"/>\r\n        <script type=\"text/javascript\" src=\"//cdn.jsdelivr.net/jquery.slick/1.6.0/slick.min.js\"></script>\r\n        \r\n        \r\n        <script src=\'/js/index.js\'></script>','\n                [[include path=\'/views/header.php\']]\n\n        <main>\n            <div class=\"wrap responsive\">\n                <div class=\"crumbs\">\n                    <ul>\n                        <li><a href=\"./\">Главная</a></li>\n                        <li><a href=\"./\">Потребителям</a></li>\n                        <li><a href=\"\">Территория обслуживания сетевой организации</a></li>\n                        <li><a href=\"\">Общая информация</a></li>\n                    </ul>\n                </div>\n                <aside class=\"section-nav\">\n                    <nav>\n                        <ul>\n                            <li>\n                                <a href=\"\" class=\"active\">Территория обслуживающей организации</a>\n                                <ol>\n                                    <li><a href=\"\">Общая информация</a></li>\n                                    <li><a href=\"\">Техническое состояние сетей </a></li>\n                                </ol>\n                            </li>\n                            <li><a href=\"\">Передача электрической энергии</a></li>\n                            <li><a href=\"\">Технологическое присоединение</a></li>\n                            <li><a href=\"\">Коммерческий учет эле